import React from "react";
import axios from "axios";
import "./View.css";
import FoodCard from "./Foodcard.jsx";
import Add from "./Add.jsx";
import { useState,useEffect } from "react";
import MenuIcon from '@mui/icons-material/Menu';
import { useNavigate } from "react-router-dom";
function View() {
    const [isMenuOpen, setIsMenuOpen] = useState(false);
    const toggleMenu = () => {
        setIsMenuOpen(!isMenuOpen);
      };
    const year = new Date().getFullYear();

    const [role,Setrole]=useState('')
    const navigate=useNavigate();
    axios.defaults.withCredentials=true;
    useEffect(()=>{
        axios.get('http://localhost:8081/View')
        .then(res=>{
            if(res.data.valid){
                Setrole(res.data.role);
            }else{
                navigate('/login')
            }
        })
        .catch(err=> console.log(err))
      })


      const handleLogout = () => {
        axios.get('http://localhost:8081/logout')
            .then(() => {
                navigate('/login');
            })
            .catch(err => console.log(err));
    };




    const handleReload = () => {
        // Use navigate to reload the current page
        
        navigate('/', { replace: true });
        window.location.reload();
      };
      

      
    return (
      <div>
        <div className="home-container">
            <div className="menu">
                <button className="menu-btn" onClick={toggleMenu}>
                    <MenuIcon/>
                </button>
                {isMenuOpen && (
                    <div className="dropdown">
                    <button className="menu-item">Contact</button>
                    <button onClick={handleReload} className="menu-item">About Us</button>
                    </div>
                )}
            </div>
            <div className="tit">
                <h2 onClick={handleReload}><img src="/images/f3.png" alt=""/>FOOD NETWORK</h2>
            </div>
            <div className="buttons-container">
                <button onClick={handleLogout} className="sig-btn">Logout</button>
            </div>
        </div>
        
        <div className="body-content1">
            <FoodCard
            image="/images/food1.jpg"
            foodName="Delicious Food"
            donorName="John Doe"
            contact="123-456-7890"
            location="City, Country"
            quantity="10 kg"
            quality="Fresh"
            foodType="Vegetables"
            condition="Good"
            />
            <FoodCard
            image="/images/food1.jpg"
            foodName="Delicious Food"
            donorName="John Doe"
            contact="123-456-7890"
            location="City, Country"
            quantity="10 kg"
            quality="Fresh"
            foodType="Vegetables"
            condition="Good"
            />
            <FoodCard
            image="/images/food1.jpg"
            foodName="Delicious Food"
            donorName="John Doe"
            contact="123-456-7890"
            location="City, Country"
            quantity="10 kg"
            quality="Fresh"
            foodType="Vegetables"
            condition="Good"
            />
