            image="/images/food1.jpg"
            foodName="Delicious Food"
            donorName="John Doe"
            contact="123-456-7890"
            location="City, Country"
            quantity="10 kg"
            quality="Fresh"
            foodType="Vegetables"
            condition="Good"
            />
            <FoodCard
            image="/images/food1.jpg"
            foodName="Delicious Food"
            donorName="John Doe"
            contact="123-456-7890"
            location="City, Country"
            quantity="10 kg"
            quality="Fresh"
            foodType="Vegetables"
            condition="Good"
            />
            <FoodCard
            image="/images/food1.jpg"
            foodName="Delicious Food"
            donorName="John Doe"
            contact="123-456-7890"
            location="City, Country"
            quantity="10 kg"
            quality="Fresh"
            foodType="Vegetables"
            condition="Good"
            />
            
        </div>

        {role==="Admin" && <View/>}
        {role==="Buyer" && <Add/>}

        <div className="footer">
            <h3>Copyright ⓒ {year}</h3>
        </div>
      </div>
    );
  }
  
  export default View;
